schema:
syntax = "proto3";
package com.cs301.shared;

option java_multiple_files = true;
option java_package = "com.cs301.shared.protobuf";
message A2C {
  string agent_id = 1;
  string client_id = 2;
  string client_email = 3;
  string crud_type = 4;
  string account_id = 5;
  string account_type = 6;
}
